import React from "react";
import { Link } from "react-router-dom";
import styled from 'styled-components';
import { navBar } from '../colors/Colors'
import mainLogo from '../assets/peloton_logo.svg'
import "./styles.css";


function NavBar() {
  return (
    <Nav>
      <Link to="/">
        <img height="75" width="90" viewBox="0 0 25 36" src={mainLogo} alt="peloton-home-logo"/>
      </Link>
      {/* <!-- Collapse button --> */}
      <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent15"
        aria-controls="navbarSupportedContent15" aria-expanded="false" aria-label="Toggle navigation">
        <span className="navbar-toggler-icon"></span>
      </button>
    </Nav>
  );
}

const Nav = styled.nav`
  background-color: ${navBar};
  text-align: left;
  margin-bottom: 50px;
  class= navbar navbar-light;
`;

export default NavBar;
